var forOwn = require('./forOwn');

    /**
     * Get object size
     */
    /**
     * Description
     * @method size
     * @param {} obj
     * @return count
     */
    function size(obj) {
        var count = 0;
        forOwn(obj, function(){
            count++;
        });
        return count;
    }

    module.exports = size;


